import React, { useState } from 'react';
import './FleetManagement.css';

const FleetManagement = () => {
  const [trucks, setTrucks] = useState([
    {
      id: 'TRK-001',
      model: 'Volvo FH16',
      location: 'Mumbai Terminal',
      nextService: '15/4/2024',
      capacity: '25,000 L',
      status: 'active',
    },
    {
      id: 'TRK-002',
      model: 'Scania R Series',
      location: 'Delhi Depot',
      nextService: '10/4/2024',
      capacity: '30,000 L',
      status: 'maintenance',
    },
    {
      id: 'TRK-003',
      model: 'Mercedes Actros',
      location: 'Bangalore Hub',
      nextService: '20/4/2024',
      capacity: '28,000 L',
      status: 'active',
    },
  ]);

  const addNewTruck = () => {
    const newTruck = {
      id: `TRK-00${trucks.length + 1}`,
      model: 'Tata Prima LX',
      location: 'Patna Yard',
      nextService: '25/4/2024',
      capacity: '26,000 L',
      status: 'active',
    };
    setTrucks([...trucks, newTruck]);
  };

  return (
    <div className="fleet-management">
      <h2>Fleet Management</h2>
      <button className="add-button" onClick={addNewTruck}>Add New Truck</button>

      <div className="truck-list">
        {trucks.map((truck) => (
          <div key={truck.id} className={`truck-card ${truck.status}`}>
            <h3>{truck.id}</h3>
            <p><strong>Model:</strong> {truck.model}</p>
            <p><strong>Location:</strong> {truck.location}</p>
            <p><strong>Next Service:</strong> {truck.nextService}</p>
            <p><strong>Capacity:</strong> {truck.capacity}</p>
            <p className="status"><strong>Status:</strong> {truck.status}</p>
            <div className="truck-actions">
              <button>View Details</button>
              <button>Schedule Service</button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default FleetManagement;
